import { HashRouter as Router, Route, Switch} from 'react-router-dom'
import React from "react";
import Homepage from './productPages/Homepage';
import CategoryProduct from './productPages/CategoryProduct';
import ProductDetails from './productPages/ProductDetails';


const AppRouter = () => {

    return(
        <React.Fragment>
            <Router>
                <Switch>
                    <Route path="/" exact component={Homepage}/>
                    <Route path="/category-product" component={CategoryProduct}/>
                    <Route path="/product-details" component={ProductDetails}/>

                    <Route path="*" component={Homepage} />

                </Switch>
            </Router>
        </React.Fragment>
    )
}

export default AppRouter;
